指にはめても楽しい、サクッと食感がアップしたリングポテトスナックです。<br>チキンやポークの肉の旨みにオニオン、セロリ、ニンジンなどの香味野菜を効かせた、じっくりコトコト煮込んだコンソメの味わいです。<br><br>原材料名：乾燥ポテト、植物油脂、野菜パウダー、粉末油脂、食塩、チキンパウダー、ブドウ糖、粉末醤油、砂糖、ミルポア風味パウダー、香辛料、粉末ソース、酵母エキスパウダー、デキストリン、ポークパウダー、たんぱく加水分解物、香味油、加工澱粉、調味料（アミノ酸等）、乳酸Ca、塩化Ca、甘味料（ステビア、スクラロース、カンゾウ）、炭酸Ca、酸味料、香料、酸化防止剤（ビタミンE）、カラメル色素、香辛料抽出物、（原材料の一部に乳成分、小麦、ゼラチンを含む）<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：東ハト<br>シリーズ名：なげわ<br>内容量：70g<br><br>購入単位：1袋<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>4901940035250 SH4811 sh4811 東ハト 東はと トーハト トウハト 東ハトなげわコンソメ味 東ハトなげわ 東ハトなげわコンソメ なげわコンソメ味 投げ輪コンソメ味 なげ輪コンソメ味 なげわコンソメ 東ハトなげわ なげわ ナゲワコンソメ味 お菓子 おかし 菓子 スナック菓子 スナック</font></td></tr></table><style type="text/css">
