●毎日肌に触れるクレンジング料だからニキビの栄養源となる「油分」をカット。オイルフリーだからお肌の潤いをとりすぎることなく、負担をかけずにオフします。<br>
●毎日使うクレンジング料だから、お肌に優しい植物由来のクレンジング成分配合。適度な厚みのあるジェルがお肌に伸び広がり、メイクを素早く浮かしてしっかり落とします。<br><br>

【ご使用方法】<br>
顔をぬらさずに、適量（さくらんぼ大程度）を手にとり、両頬、額、鼻、あごにのせマッサージを顔全体にひろげ、よくメイクとなじませ水またはぬるま湯で洗い流します。<br><br>

【ご注意】<br>
○目に入った場合はすぐに水かぬるま湯で洗い流してください。<br>
○直射日光にあたるところや、極端に高温、低温のところには置かないでください。<br>
○乳幼児の手の届かないところに置いて下さい。<br>
○肌にあわないとき、また、傷・はれもの・湿疹等の異常があるときは、使用しないでください。<br>
○使用中、または使用後に、赤味・はれ・かゆみ・刺激等の異常があらわれたときは、使用を中止し、皮膚科専門医等にご相談ください。そのまま使用を続けますと、悪化することがあります。 <br><br>

【成分】<br>
有効成分：グリチルリチン酸ジカリウム<br>
その他の成分：１，３-ブチレングリコール、カルボキシビニルポリマー、ポリオキシエチレンヤシ油脂肪酸グリセリル、モノラウリン酸ポリグリセリル、１，２-ペンタンジオール、天然ビタミンＥ、ヒオウギ抽出液、水酸化ナトリウム、ヒドロキシエタンジホスホン酸液、フェノキシエタノール、グリセリンモノ２-エチルヘキシルエーテル、無水エタノール <br><br>

【内容量】<br>
100g<br><br>

【販売元】<br>
株式会社アクネスラボ<br>
東京都調布市布田1-43-9
お問い合わせ先：042-484-1584<br><br>

