●うるおい成分天然セラミド（ビオセラミド）を、超微細な「ナノ粒子」に致しました。この「ナノ粒子」は、角質層の間に浸透します。そのため、肌をすみずみまでやさしく整え、気持ちまで軽くなるような、うれしい使い心地が実現されました。<br>
●無香料・無着色・鉱物油無添加・表示指定成分無添加・ノンアルコール（エチルアルコール無添加）・ノンパラベン<br>
●パッチテスト済。（すべての方に刺激がないというわけではありません）<br><br>

【効能・効果】<br>
皮ふの清浄、にきび及び肌あれを防ぐ。 <br><br>

【使用方法】<br>
500円玉位を手にとり、やさしく顔全体になじませてください。メイク汚れが浮き上がると、指先の感触がふっと軽くなり、ジェルがなめらかな液状にかわります。その後、水またはぬるま湯でよく洗い流してください。 <br><br>

【ご注意】<br>
○傷やはれもの、しっしん等異常のある部位には、お使いにならないでください。<br>
○本品がお肌に合わないときは、ご使用をおやめください。そのまま使用を続きますと、症状を悪化させることがありますので、皮ふ科専門医等にご相談されることをおすすめします。<br>
1.使用中、赤味、はれ、かゆみ、刺激等の異常があらわれた場合。<br>
2.使用したお肌に、日光があたって上記のような異常があらわれた場合。<br>
○目に入らないようにご注意ください。万一、目に入ったときは、直ちに水またはぬるま湯で洗い流してください。<br>
○お肌が特にかぶれやすい方は、腕の内側などの柔らかいところに少量つけて、かゆみ、赤味などの異常がないことを確かめてからご使用ください。<br>
○使用後は容器の口を清潔に保ち、キャップをしめて保管してください。<br>
○乳幼児の手の届かないところに保管してください。<br>
○直射日光のあたる場所、極端に高温または低温の場所には保管しないでください。<br>○使用期限（未開封時）を過ぎた製品は、使用しないでください。<br><br>

【成分】<br>
有効成分：グリチルリチン酸2Ｋ、ε-アミノカプロン酸<br>
その他の成分：α-オレフィンオリゴマー、トリオクタン酸グリセリル、ソルビット液、水、濃グリセリン、メチルフェニルポリシロキサン、イソノナン酸イソノニル、イソステアリン酸ＰＯＥグリセリル、ジメチコン、カンゾウ葉エキス、植物性スクワラン、トリメチルグリシン、ビオセラミド、アルギン酸Ｎａ、ステアリン酸ポリグリセリル、天然ビタミンＥ、トリイソステアリン酸ＰＯＥグリセリル、ＰＯＥ硬化ヒマシ油、ＢＧ、フェノキシエタノール、ヤシ油脂肪酸アシルグルタミン酸Ｋ、粘度調整剤、ｐＨ調整剤 <br><br>

【内容量】<br>
